根据UUID获取一个Label Record的历史记录
Request

Method: GET
URL: /label/:id/history
Headers: Authorization:  需要携带bearer token
Body:

Response

Success Body (200):
{
  "status": true,
  "message": "OK!",
  "errors": null,
  "data": {
     "history": [
         {
             "timestamp": "DD-MM-YYYY", // ISO date and time,
